  FilterJSONData(ev:any){
    this.initializaJSONData();
    const val = ev.target.value;
    if(val && val.trim() != '')
    {
      this.jsonData = this.jsonData.filter((item) => {
        return (item.Name.toLowerCase().indexOf(val.toLowerCase()) > -1 );
      })
    }
  }

